export const prettyUrltoDBItem = (productName) => {
  let name = productName;

  // console.log('product name is a :', typeof productName);
  console.log('name is:',  name);
  
  if (productName.inlcudes('-')) {
    name = productName.repalce('-', ' ');
  }
  
  console.log('name is now:', typeof name);
  return name;
}
